/* #region Coach Bernadette's Bio Page-Specific Custom Variables */

:root {
  --gallery_width: 95vw;
  --slide_padding--bio_quote_and_bio_text: 5vw;
  --font_size--bio_quote: 1.725rem;
  --font_size--bio_text: 1.25rem;
}

/* #endregion */

/* #region "Swipe left or right to read Coach Berandette's biography!" */

/* Style "swipe left or right" instructions. */
span.swipe_instructions {
  font-family: "Pacifico", cursive;
  font-size: 2rem;
  font-weight: 700;
}

/* Use margin to "push" left & right arrows away from <p> text. */
div.gray_hero i.fa-arrow-alt-circle-left {
  margin-right: 15px;
}

div.gray_hero i.fa-arrow-alt-circle-right {
  margin-left: 15px;
}

div.swipe_container {
  display: flex;
  justify-content: center;
  align-items: center;
  margin-top: 25px;
}

div.swipe_container .icon__swipe {
  width: auto;
  height: auto;
}

/* #endregion */

/* #region Carousel Container for All Coach Bernadette's Bio "Slides" */

/* Frederic R's CSS From "Minimal Carousel with horiztonal scroll + snap, mobile & mouse friendly" codepen:
	      https://codepen.io/fredericrous/pen/xxVXJYX */

div.carousel_container {
  align-items: center;
  /* font-size: 20px;
	font-size: 1.75rem; */
}

.gallery {
  display: grid;
  width: var(--gallery_width);
  height: var(--gallery_height);
  grid-template-columns: repeat(15, var(--gallery_width));
  grid-template-rows: 1fr;
  grid-column-gap: 25vw;
  grid-row-gap: 1rem;
  /* .gallery's width must match li.slide's width in #region All Slides! */
  width: var(--gallery_width);
  border: 1px solid black;
  overflow: scroll;
  scroll-snap-type: both mandatory;
  -webkit-scroll-snap-type: both mandatory;
  -ms-scroll-snap-type: both mandatory;
  scroll-padding: 1rem;
  background: var(--brand_color_3);
  box-shadow: 2px 2px 1px var(--black);
}

.active {
  scroll-snap-type: unset;
  -webkit-scroll-snap-type: unset;
  -ms-scroll-snap-type: unset;
}

/* #endregion */

/* #region All Slides  */

.slide {
  /* Implement Flex Box at the "top level" of all slides. */
  display: flex;
  flex-wrap: wrap;
  /* Center all slides in middle of slide container. */
  justify-self: center;
  /* Prevent individual slide from growing to fill excess space in carousel row. */
  align-self: center;
  /* Remove default margin from li item. */
  margin: 0;
  /* li.slide's width must match .gallery's width!*/
  width: var(--gallery_width);
  /* Snap slides to center as user swipes from slide-to-slide. */
  scroll-snap-align: center;
}

.slide_1,
.slide_2,
.slide_3,
.slide_4,
.slide_5,
.slide_6,
.slide_7,
.slide_8,
.slide_10,
.slide_11,
.slide_12,
.slide_13,
.slide_14,
.slide_15 {
  align-content: center;
}

.slide_6,
.slide_11 {
  justify-content: space-around;
}

.slide--text {
  display: flex;
  flex-direction: column;
}

.slide span.slide--bio_quote {
  text-align: center;
  max-width: 50ch;
  margin-bottom: 2.5vh;
  /* padding-left: var(--slide_padding--bio_quote_and_bio_text); */
  font-size: var(--font_size--bio_quote);
  font-weight: 800;
  color: var(--brand_color_1);
  text-shadow: 1px 1px 1px var(--white);
}

.slide p {
  max-width: 55ch;
  padding-left: var(--slide_padding--bio_quote_and_bio_text);
  font-size: var(--font_size--bio_text);
}
.slide_2 p:first-of-type,
.slide_3 p:first-of-type,
.slide_6 p:first-of-type,
.slide_7 p:first-of-type,
.slide_8 p:first-of-type,
.slide_9 p:first-of-type,
.slide_10 p:first-of-type,
.slide_11 p:first-of-type,
.slide_12 p:first-of-type,
.slide_14 p:first-of-type,
.slide_4 span.slide--bio_quote,
.slide_5 span.slide--bio_quote,
.slide_13 span.slide--bio_quote,
.slide_15 span.slide--bio_quote {
  margin-top: 25px;
}

.slide--image {
  display: flex;
  flex-direction: column;
}

/* Prompts users to engage with interactable content. */

span.slide--instructions {
  display: inline-block;
  text-align: center;
  width: 100%;
  font-size: 1.15rem;
  font-style: italic;
  font-weight: 700;
}

/* #endregion */

/* #region Slide 1: "Once upon a time, you were a little girl ..." */

.slide_1 {
  flex-direction: row;
  justify-content: space-evenly;
}

.slide_1--text {
  width: 60%;
  padding: 20px;
}

.slide_1--image {
  width: 40%;
  min-width: 350px;
  align-content: center;
  justify-content: center;
}

/* #region Slide 1: Sass TV */

.television {
  width: 100%;
}

.television__top {
  width: 40%;
  margin: auto;
  position: relative;
}

.television__antenna {
  width: 5px;
  height: 100px;
  background-color: #3b3733;
  margin-bottom: -10px;
}

.television__antenna--left {
  transform: rotate(-30deg);
  float: left;
}

.television__antenna--right {
  transform: rotate(30deg);
  float: right;
}

.television__antenna__base {
  height: 20px;
  background-color: #3b3733;
  background-color: #7d4d25;
  border-top-left-radius: 48px;
  border-top-right-radius: 48px;
  border: 3px solid black;
  clear: both;
  position: relative;
  z-index: 2;
}

.television__center {
  position: relative;
  z-index: 2;
  max-width: 350px;
  width: 85%;
  height: 200px;
  background-color: #7a4e27;
  background-color: #121110;
  border: solid 3px #eef4c4;
  border: solid 3px var(--black);
  border: solid 2px black;
  box-shadow: -10px -10px #d64832;
  box-shadow: -5px -10px var(--black);
  box-shadow: none;
  border-radius: 48px;
  margin: 0 auto;
  padding: 10px 15px;
}

.television__screen {
  display: flex;
  justify-content: center;
  width: 270px;
  width: 100%;
  height: 190px;
  height: 100%;
  background-color: #eed5b6;
  background-color: var(--black);
  background-color: #3b3733;
  background-color: #7d4d25;
  background-color: #dd137b;
  background-color: #3b3733;
  background-color: #7d4d25;
  border-radius: 48px;
  /* float: left; */
}

/* Video element is nested within television__screen. */
video {
  box-sizing: border-box;
  overflow: hidden;
  /* border: 10px solid; */
  border-radius: 50px;
  transform: scaleX(1.25);
}

.television__base {
  width: 60%;
  margin: auto;
}

.television__base:after {
  clear: both;
  content: "";
  display: table;
}

.television__foot {
  width: 20px;
  height: 70px;
  margin-top: -35px;
  background-color: #7d4d25;
  border: solid 3px #eed5b6;
  border: solid 3px black;
  border-radius: 48px;
}

.television__foot--left {
  transform: rotate(30deg);
  float: left;
}

.television__foot--right {
  transform: rotate(-30deg);
  float: right;
}

.p {
  margin-top: 70px;
}

/* #endregion */
/* #endregion */

/*#region Slide 2: Discovering Coaching */

.slide_2--text {
  align-self: center;
  width: 50%;
}

.slide_2--text p {
  max-width: 55ch;
}

.slide_2--image {
  flex-direction: row;
  justify-content: space-evenly;
  align-items: center;
  width: 50%;
}

.slide_2--image img {
  width: 100%;
}

.slide_2--image div.adler {
  display: flex;
  flex-direction: column;
  width: 40%;
}

.slide_2--image div.rcb {
  display: flex;
  justify-content: center;
  width: 40%;
  margin-top: 25px;
}

.slide_2--image div.rcb img {
  width: 60%;
  height: 75%;
}

.slide_2--image div.adler img {
  height: 80%;
}

.slide_2--image span {
  text-align: center;
  /* align-self: center; */
  padding-top: 5px;
  font-size: 0.9rem;
  font-size: 1.15rem;
  font-weight: 700;
  color: var(--black);
}

/* #endregion */

/* #region Slide 3: INCF & Coach U Certifications & Coach Bernadette As A Young Mom with Parenting Recipes */

.slide_3--text {
  align-self: center;
  width: 50%;
}

.slide_3--image {
  justify-content: center;
  align-items: center;
  width: 50%;
}

.slide_3--image img {
  width: 90%;
}

.slide_3--image div.young_coach_bernadette_mom,
.slide_3--image div.parenting_recipes {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 50%;
}

.slide_3--image img {
  width: 250px;
  height: 200px;
  border-radius: var(--border_radius);
}

.slide_3--image div.parenting_recipes {
  margin-top: 25px;
}

.slide_3--image span {
  text-align: center;
  width: 250px;
  padding: 10px;
  font-size: 0.9rem;
  font-weight: 700;
  color: var(--black);
}

.slide_3--image span#parenting_recipes_title {
  font-style: italic;
}

/* #endregion */

/* #region Slide 4: "Sometimes forever isn't isn't forever, after all." */

.slide_4--text {
  align-self: center;
  width: 60%;
}

.slide_4--text p {
  max-width: 55ch;
}

.slide_4--text .slide--bio_text {
  display: flex;
  flex-direction: column;
  /* align-self: center; */
}

.slide_4--image {
  display: flex;
  width: 40%;
  min-width: 350px;
  min-height: 300px;
  justify-content: center;
  align-self: center;
  align-items: center;
}

/* #region Slide 4: Sass Rain Cloud */
/* aexcodes CSS from "Thunderstorm Weather Icon | HTML, CSS" Codepen:
	https://codepen.io/aexcode/pen/vYyQNWQ */

.slide_4--image .container {
  width: 80%;
}
.slide_4--image .container .canvas {
  position: relative;
  padding-top: 100%;
  background: var(--brand_color_1);
  border-radius: 50%;
  overflow: hidden;
}

/* Rain cloud middle "cotton ball". */
.slide_4--image .cloud {
  position: absolute;
  width: 40%;
  height: 40%;
  top: 27.5%;
  left: 30%;
  background: #fffafa;
  border-radius: 44% 56% 49% 51% / 71% 63% 37% 29%;
  animation: cloudColorChange 3s linear infinite;
}

/* Rain cloud left "cotton ball". */
.slide_4--image .cloud:before {
  content: "";
  position: absolute;
  width: 85%;
  height: 85%;
  top: 10%;
  left: -50%;
  right: -50%;
  background: inherit;
  right: unset;
  border-radius: 52% 48% 58% 42% / 43% 61% 39% 57%;
}

/* Rain cloud right "cotton ball". */
.slide_4--image .cloud:after {
  content: "";
  position: absolute;
  width: 85%;
  height: 85%;
  top: 10%;
  left: -50%;
  right: -50%;
  background: inherit;
  left: unset;
  border-radius: 52% 48% 49% 51% / 43% 61% 39% 57%;
}

.slide_4--image .cloud .cloud-copy {
  z-index: 2;
  position: absolute;
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  background: inherit;
  border-radius: inherit;
}
.slide_4--image .cloud .cloud-copy:before {
  content: "";
  position: absolute;
  width: 85%;
  height: 85%;
  top: 10%;
  left: -50%;
  right: -50%;
  background: inherit;
  right: unset;
  border-radius: 52% 48% 58% 42% / 43% 61% 39% 57%;
}
.slide_4--image .cloud .cloud-copy:after {
  content: "";
  position: absolute;
  width: 85%;
  height: 85%;
  top: 10%;
  left: -50%;
  right: -50%;
  background: inherit;
  left: unset;
  border-radius: 52% 48% 49% 51% / 43% 61% 39% 57%;
}
.slide_4--image .cloud .rain {
  position: absolute;
  width: 140%;
  height: 100%;
  left: -20%;
  top: 80%;
  z-index: 1;
  overflow: hidden;
}

.slide_4--image .cloud .rain .lightning {
  position: absolute;
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  animation: lightningFlash 2s linear infinite;
}

.slide_4--image .cloud .rain .lightning:before {
  content: "";
  position: absolute;
  width: 10%;
  height: 50%;
  left: 47%;
  top: 5%;
  right: 47%;
  bottom: 5%;
  transform: rotate(20deg);
  background: #fcd422;
  bottom: unset;
  right: unset;
  clip-path: polygon(50% 0%, 0% 100%, 100% 100%);
}
.slide_4--image .cloud .rain .lightning:after {
  content: "";
  position: absolute;
  width: 10%;
  height: 50%;
  left: 47%;
  top: 5%;
  right: 47%;
  bottom: 5%;
  transform: rotate(20deg);
  background: #fcd422;
  top: unset;
  left: unset;
  clip-path: polygon(50% 100%, 0 0, 100% 0);
}
/* #endregion */
/* #region Slide 4: Sass Rain Cloud: .cloud nth-of-types */

.cloud .rain .drop:nth-of-type(1) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s 1s linear infinite;
  left: 10%;
}
.cloud .rain .drop:nth-of-type(2) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s linear infinite;
  left: 28.5%;
}
.cloud .rain .drop:nth-of-type(3) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s 1s linear infinite;
  left: 47%;
}
.cloud .rain .drop:nth-of-type(4) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s linear infinite;
  right: 28.5%;
}
.cloud .rain .drop:nth-of-type(5) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s 1s linear infinite;
  right: 10%;
}
.cloud .rain .drop:nth-of-type(6) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s 2s linear infinite;
  left: 28.5%;
}
.cloud .rain .drop:nth-of-type(7) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s 2s linear infinite;
  right: 28.5%;
}
.cloud .rain .drop:nth-of-type(8) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s 3s linear infinite;
  left: 10%;
}
.cloud .rain .drop:nth-of-type(9) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s 3s linear infinite;
  left: 47%;
}
.cloud .rain .drop:nth-of-type(10) {
  position: absolute;
  width: 3%;
  height: 20%;
  top: -20%;
  background: #fffafa;
  border-radius: 1rem;
  transform: rotate(22deg);
  animation: rainDropFall 4s 3s linear infinite;
  right: 10%;
}

/* #endregion */
/* #region Slide 4: Sass Rain Cloud: Keyframes */
@keyframes cloudColorChange {
  0%,
  100% {
    background: #fffafa;
  }
  50% {
    background: #a3a3a3;
  }
}

@keyframes rainDropFall {
  15% {
    opacity: 1;
  }
  75% {
    opacity: 0;
  }
  100% {
    top: 120%;
    opacity: 0;
  }
}
@keyframes lightningFlash {
  0%,
  39% {
    opacity: 0;
  }
  40%,
  60% {
    opacity: 1;
  }
  61%,
  100% {
    opacity: 0;
  }
}
/* #endregion */
/* #endregion */

/* #region Slide 5: "Little girls with dreams become women with vision*/

.slide_5--text {
  align-self: center;
  width: 50%;
}

.slide_5--image {
  position: relative;
  width: 50%;
  min-width: 350px;
  min-height: 350px;
}

/* #region Slide 5: Sass Rocket Ship */

.rocket {
  width: 150px;
  height: 150px;
  position: absolute;
  top: 10%;
  left: 55%;
}

/* #region Slide 5: Sass Rocket Ship: Tank */

.external-tank {
  width: 30px;
  height: 100px;
  background: #d49459;
  position: absolute;
  border-radius: 15px 15px 0 0;
  box-shadow: inset 5px 5px 0 #b17e4d;
  z-index: 4;
}
.external-tank:before {
  content: "";
  border: 15px solid transparent;
  border-top: 15px solid #d49459;
  position: absolute;
  bottom: -30px;
}
.external-tank:after {
  content: "";
  border: 15px solid transparent;
  border-bottom: 15px solid #898a88;
  position: absolute;
  bottom: -20px;
}
.external-tank .rocket-booster {
  width: 8px;
  height: 100px;
  background: #fff;
  position: absolute;
  left: 50%;
  top: 25%;
  z-index: 2;
  margin-left: -4px;
  -webkit-filter: drop-shadow(#cfcece -2px 0 0);
}
.external-tank .rocket-booster:before {
  content: "";
  border: 4px solid transparent;
  border-bottom: 8px solid #fff;
  position: absolute;
  top: -12px;
  left: 0px;
}
.external-tank .rocket-booster:after {
  content: "";
  border: 8px solid transparent;
  border-bottom: 12px solid #fff;
  position: absolute;
  bottom: -6px;
  left: -4px;
}

/* #endregion */

/* #region Slide 5: Sass Rocket Ship: Shuttle */

.shuttle {
  width: 30px;
  height: 100px;
  background: #fff;
  position: absolute;
  left: 32px;
  top: 15px;
  border-radius: 3px 50px 0 0;
  -webkit-filter: drop-shadow(rgba(0, 0, 0, 1) 0 0 2px);
  box-shadow: inset 3px 0 1px rgba(0, 0, 0, 0.2), inset 1px 0 0 rgba(0, 0, 0, 1);
  z-index: 3;
}
.shuttle:before {
  content: "";
  width: 10px;
  height: 30px;
  border-radius: 0 0 80% 3px;
  background: #fff;
  position: absolute;
  bottom: -8px;
  right: -10px;
  transform: rotate(-45deg);
}
.shuttle:after {
  content: "";
  width: 1px;
  height: 40px;
  background: rgba(50, 50, 50, 0.1);
  position: absolute;
  left: 5px;
  top: 50%;
}
.shuttle .window {
  width: 8px;
  height: 30px;
  background: #000;
  position: absolute;
}
.shuttle .window:before {
  content: "";
  width: 5px;
  height: 10px;
  background: #000;
  position: absolute;
  transform: rotate(10deg);
  border-radius: 2px 8px 0 0;
  left: 14px;
  top: 5px;
}

.shuttle .window:after {
  content: "";
}

/* #endregion */

/* #region Slide 5: Sass Rocket Ship: Thrusters */
.thrusters {
  position: absolute;
  top: 70%;
  left: 30px;
  border: 8px solid transparent;
  border-bottom: 15px solid #9d9e9d;
  z-index: 2;
}
.thrusters:before {
  content: "";
  position: absolute;
  top: -8px;
  left: 5px;
  border: 8px solid transparent;
  border-bottom: 15px solid #9d9e9d;
}
.thrusters:after {
  content: "";
  position: absolute;
  top: -12px;
  left: -5px;
  border: 11px solid transparent;
  border-bottom: 20px solid #8c8d8b;
}
/* #endregion */

/* #region Slide 5: Sass Rocket Ship: Flames */
.flames {
  width: 44px;
  height: 120px;
  background: #ce7e3d;
  position: absolute;
  top: 116px;
  left: -6px;
  border-radius: 60% 60% 100% 100%;
  z-index: 0;
}
.flames:before {
  content: "";
  width: 30px;
  height: 110px;
  position: absolute;
  left: 10px;
  background: #e0b144;
  border-radius: 100%;
}
.flames:after {
  content: "";
  width: 25px;
  height: 100px;
  position: absolute;
  left: 10px;
  background: #f8e546;
  border-radius: 100%;
}
.flames.right {
  left: 23px;
  top: 114px;
  z-index: 0;
  height: 150px;
}
.flames.right:before {
  height: 140px;
}
.flames.right:after {
  height: 130px;
}

/* #endregion */

/* #region Slide 5: Space Shuttle Smoke */
.smoke {
  position: absolute;
  top: 132px;
  left: 5px;
  width: 5px;
  height: 5px;
}
.smoke .s-1 {
  border-radius: 50%;
  position: absolute;
  background: #adadac;
  background: var(--brand_color_1);
  width: 22px;
  height: 22px;
  top: -4px;
  left: -3px;
  z-index: 2;
}
.smoke .s-2 {
  border-radius: 50%;
  position: absolute;
  background: #adadac;
  background: var(--brand_color_2);
  width: 18px;
  height: 18px;
  top: 4px;
  left: -3px;
  z-index: 2;
}
.smoke .s-3 {
  border-radius: 50%;
  position: absolute;
  background: #adadac;
  background: var(--brand_color_1);
  width: 22px;
  height: 22px;
  top: 8px;
  left: -1px;
