.ui {
  position: absolute;
  top: 50%;
  left: 75%;
  perspective: 400px;
  /* Filter / Drop-Shadow created double in original animation? */
  /* filter: drop-shadow(300px 0px 0px #fff); */
  transform: translateX(-150px);
}
.ui .dice {
  transform-style: preserve-3d;
  animation: rotate 10000ms linear infinite;
  animation: rotate 20000ms linear infinite;
}
.ui .dice_list {
  transform: translateY(-75px) translateX(-75px);
  transform-style: preserve-3d;
}
.ui .dice_item {
  display: flex;
  justify-content: center;
  align-items: center;
  position: absolute;
  width: 150px;
  height: 150px;
  border-radius: 20px;
  border: 10px double var(--brand_color_2);
  background: var(--brand_color_1);
  font-size: 4rem;
  font-family: "Open Sans", sans-serif;
  color: rgba(0, 0, 0, 0.6);
}
.ui .dice_item[data-id="1"] {
  transform: translateZ(75px);
}
.ui .dice_item[data-id="2"] {
  transform: translateY(75px) rotateX(270deg);
}
.ui .dice_item[data-id="3"] {
  transform: translateX(75px) rotateY(-270deg);
}
.ui .dice_item[data-id="4"] {
  transform: translateX(-75px) rotateY(-90deg);
}
.ui .dice_item[data-id="5"] {
  transform: translateY(-75px) rotateX(90deg);
}
.ui .dice_item[data-id="6"] {
  transform: translateZ(-75px) rotateY(180deg);
  /* text-decoration: underline; */
}

/* #endregion */

/* #region Slide 7: Plenty of Bad Dates: CSS Dice Animation: Keyframes */
@keyframes rotate {
  0% {
    transform: rotateX(0deg) rotateY(0deg);
  }
  100% {
    transform: rotateX(360deg) rotateY(720deg);
  }
}

