.fishing .rope {
  background-position: -127px 0px;
  top: 0em;
  left: 50%;
  margin-left: -3px;
  width: 12px;
  height: 100px;
  transition: transform 550ms ease;
}
.circle:hover > .mask-a > .fishing {
  transform: translate3d(0, 2.6em, 0);
  transition: transform 750ms cubic-bezier(0.68, -0.55, 0.265, 1.65);
}
.circle:hover > .mask-a > .fishing > .hook {
  animation: rot 975ms 300ms ease-in-out;
}
.circle:hover > .mask-a > .fish-green {
  transform: translate3d(-1.8em, 0, 0) rotateZ(0deg);
  transition: transform 750ms ease;
}
.circle:hover > .mask-a > .fish-red {
  transform: translate3d(1em, 0, 0) rotateZ(0deg);
  transition: transform 750ms ease;
}
.circle:hover > .mask-a > .fish-yellow {
  transform: translate3d(-4.3em, -1.5em, 0) rotateZ(0deg);
  transition: transform 750ms ease;
}
@keyframes rot {
  25% {
    transform: translate3d(0, 0, 0) rotateZ(-8deg);
  }
  75% {
    transform: translate3d(0, 0, 0) rotateZ(2deg);
  }
}

