.wedding_ring {
  box-sizing: border-box;
  width: 200px;
  height: 80px;
  position: absolute;
  left: 50%;
  top: 50%;
  margin-left: -100px;
  margin-top: 30px;
  background-color: white;
  background-color: var(--brand_color_1);
  /* background-image: linear-gradient(
	    to bottom,
	    transparent 15px,
	    black 15px,
	    black 17px,
	    transparent 17px
	  ),
	  linear-gradient(to left, white 80%, transparent 80%),
	  radial-gradient(circle, black 20%, transparent 20%),
	  radial-gradient(circle, black 20%, transparent 20%); */
  background-size: 100% 100%, 100% 100%, 10px 10px, 10px 10px;
  background-position: 0 0, 0 0, 0 0, 5px 5px;
  border-radius: 5px 5px 20px 20px;
  border: 5px solid black;
  z-index: 1;
}
.wedding_ring:before,
.wedding_ring:after {
  display: block;
  content: "";
  position: absolute;
  box-sizing: border-box;
}
.wedding_ring:before {
  width: 200px;
  height: 70px;
  left: 50%;
  bottom: 70px;
  margin-left: -100px;
  background-color: #aaa;
  background-color: #dd137b;
  background-image: radial-gradient(
      circle,
      transparent 26px,
      black 26px,
      black 29px,
      white 29px,
      white 36px,
      black 36px,
      black 39px,
      transparent 39px
    ),
    linear-gradient(to bottom, black, black),
    linear-gradient(to bottom, black, black),
    linear-gradient(
      45deg,
      transparent 10px,
      black 10px,
      black 12px,
      transparent 12px
    ),
    linear-gradient(
      -45deg,
      transparent 10px,
      black 10px,
      black 12px,
      transparent 12px
    ),
    linear-gradient(to right, black, black),
    linear-gradient(
      45deg,
      transparent 10px,
      black 10px,
      black 13px,
      white 13px,
      white 100%
    ),
    linear-gradient(
      -45deg,
      transparent 10px,
      black 10px,
      black 13px,
      white 13px,
      white 100%
    ),
    linear-gradient(
      -45deg,
      white 13px,
      black 13px,
      black 16px,
      transparent 16px,
      transparent 100%
    ),
    linear-gradient(
      45deg,
      white 13px,
      black 13px,
      black 16px,
      transparent 16px,
      transparent 100%
    ),
    radial-gradient(circle, rgba(0, 0, 0, 0.3) 20%, transparent 20%),
    radial-gradient(circle, rgba(0, 0, 0, 0.3) 20%, transparent 20%),
    linear-gradient(to bottom, rgba(255, 255, 255, 0.3) 20px, transparent 20px),
    linear-gradient(to top, rgba(255, 255, 255, 0.5) 20px, transparent 20px),
    linear-gradient(-145deg, transparent 17px, white 17px),
    linear-gradient(-35deg, transparent 17px, white 17px),
    linear-gradient(145deg, transparent 17px, white 17px),
    linear-gradient(35deg, transparent 17px, white 17px);
  background-repeat: no-repeat, no-repeat, no-repeat, no-repeat, no-repeat,
    no-repeat, no-repeat, no-repeat, no-repeat, no-repeat, repeat, repeat,
    no-repeat, no-repeat, no-repeat, no-repeat, no-repeat, no-repeat;
  background-size: 100px 100px, 20px 3px, 34px 2px, 20px 7px, 20px 7px, 2px 14px,
    24px 15px, 24px 15px, 24px 10px, 24px 10px, 10px 10px, 10px 10px, 100% 100%,
    100% 100%, 30px 60%, 30px 60%, 30px 60%, 30px 60%;
  background-position: center bottom -50px, center bottom 59px,
    center bottom 51px, left 78px bottom 52px, right 78px bottom 52px,
    center bottom 38px, left 75px bottom 37px, right 75px bottom 37px,
    left 73px bottom 52px, right 73px bottom 52px, left bottom,
    left 5px bottom 5px, left top, left bottom, left top, left bottom, right top,
    right bottom;
  border-radius: 20px;
  border: 5px solid black;
  box-shadow: inset -30px 30px 10px rgba(0, 0, 0, 0.3);
  animation: inside 10000ms infinite;
}
.wedding_ring:after {
  width: 200px;
  height: 80px;
  left: 50%;
  bottom: 75px;
  margin-left: -100px;
  background-color: white;
  background-color: #dd137b;
  /* background-image: linear-gradient(to left, white 80%, transparent 80%),
