/* #region Media Queries -- Smartphones */

@media screen and (min-width: 0px) and (max-width: 575px) {
  /* Resize all circular image on all slides to the same width & height on mobile view */
  .slide_4--image div.container,
  .slide_12 .circle,
  .slide_14--image img {
    cursor: pointer;
    width: 215px;
    height: 215px;
  }

  div.dating__footer--2 span.dating__account {
    font-size: 0.95rem;
  }
}

/* #endregion */

/* Custom positioning of Slide 7's rotating die to center-ish on tablet view. */
.slide_7 .ui {
  left: 95%;
}

@media screen and (min-width: 0px) and (max-width: 685px) {
  .slide_3--image img {
    width: 90%;
    height: 175px;
  }

  .slide_3--image span {
    width: 200px;
  }
}

@media screen and (min-width: 922px) and (max-width: 1220px) {
  .rocket {
    left: 40%;
  }
}

@media screen and (min-width: 576px) and (max-width: 1024px) {
  /* Changed max-width from 921px to 1024px on 4/18/21 to resolve issues on tablet horizontal view. */

  /* Resize all circular image on all slides to the same width & height on mobile view */

  .slide_4--image div.container {
    width: 45%;
    height: 45%;
  }

  .slide_7 .ui {
    left: 75%;
    left: 70%;
  }

  .slide_12 .circle,
  .slide_14--image img {
    cursor: pointer;
    width: 215px;
    height: 215px;
  }
}

@media screen and (min-width: 650px) and (max-width: 1024px) {
  .slide_1--image .television {
    width: 65%;
  }
}

@media screen and (min-width: 0px) and (max-width: 1024px) {
  /* Max-widht was initially 921px but it was changed to 1024px to prevent the desktop CSS Grid carousel
	  from appearing on tablets in horizontal mode. */
  .cb-responsive--show_mobile {
    display: initial;
  }

  .cb-responsive--hide_mobile {
    display: none;
  }

  /*  Restyle slides on mobile screens by:
	      &&&   Stacking slides' image & text containers by changing flex-direction from "row" to "column"
	      &&&   Centering image & text containers within column-ized slide. */

  .slide {
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }

  /* Restyle slide text & image  on mobile screens by:
	    &&&   Stretching slide text & image containers across 100% of their flex container
	    &&&   Centering content within text & image flex containers */

  .slide--text,
  .slide--image {
    justify-content: space-evenly;
    align-items: center;
    width: 100%;
  }

  /* Restyle slide text on mobile screens by:
	    &&&   Applying "base" spacing between slide text (top) and slide image (bottom) */

  .slide--text {
    margin-bottom: 55px;
  }

  .slide--image {
    flex-direction: row;
  }

  /* Top margin on Parenting Recipes div not needed when image are displayed side-by-side. */
  .slide_3--image div.parenting_recipes {
    margin-top: initial;
  }

  .slide_5--image {
    /* Add height to card to "recoup" uniform bottom-margin spacer applied to all slide--text divs. */
    height: 400px;
    /* Add margin-bottom to card to further "recoup" space taken up by rocket. */
    margin-bottom: 30px;
  }

  div.rocket {
    top: 25%;
    left: 58%;
    width: 100%;
    margin: -100px 0 0 -100px;
  }

  /* "Crop" selected smoke plumes of Sass Rocket on smaller screens. */

  .slide_5--image i.s-16,
  .slide_5--image i.s-17,
  .slide_5--image i.s-18,
  .slide_5--image i.s-19,
  .slide_5--image i.s-20 {
    display: none;
  }

  .slide_7--image {
    height: 1px;
  }

  .slide_8--image {
    margin-top: 25px;
  }

  .slide_9--image {
    width: 90%;
    height: 300px;
  }

  .slide_10--image,
  .slide_11--image {
    /* For some reason, none of the standard flex-box centering techniques 
	      work on this div? */
    margin: 0 auto;
  }

  .slide_13 span {
    max-width: 40ch;
  }

  .slide_13--image {
    margin-top: 175px;
  }

  .slide_15--image img {
    width: 200px;
  }

  .slide_15--image span.slide--instructions {
    font-size: 1.4rem;
  }
}
