a#developer_link {
  /* Underlining things in CSS can be surprisingly difficult!!  
*
*    To ensure the underline-on-hover effect I applied to all links 
*    in the main element wrapped across lines, I tweaked Nicky Meuleman's
*    code in this wonderful article:
*
*    https://nickymeuleman.netlify.app/blog/css-animated-wrapping-underline 
*
*     NOTE: This is a nearly identical, but seperate, set of CSS styles based
*     on main a styling in _base.scss. */
  text-decoration: none;
  background-image: linear-gradient(rgba(255, 255, 0, 0), rgba(255, 255, 0, 0)),
    linear-gradient(rgba(255, 255, 0, 0), rgba(255, 255, 0, 0));
  background-size: 100% 2px, 0 2px;
  background-position: 100% 100%, 0 100%;
  background-repeat: no-repeat, no-repeat;
  transition: background-size 0.4s linear, background-image 0.4s ease-in-out;
  color: var(--yellow);
  font-weight: 200;
}

a#developer_link:hover {
  background-image: linear-gradient(
      rgba(255, 255, 0, 0),
      rgba(255, 255, 255, 0)
    ),
    linear-gradient(rgba(255, 255, 0, 1), rgba(255, 255, 0, 1));
  background-size: 0 2px, 100% 2px;
}

