sources.scss/layouts/_meet_cute_individual_issue:
/* #region General & Main Selectors & Styles */

main.meet-cute--individual_issue {
  display: flex;
  flex-direction: column;
}

main.meet-cute--individual_issue {
  scroll-padding: 2rem;
}

/* Adjustments to this div's width using media queries 
  should "cascade" across all other elements within this template. */

main.meet-cute--individual_issue .meet-cute--individual_issue--background {
  display: flex;
  flex-direction: column;
  align-self: center;
  width: 80%;
  margin-top: 50px;
  margin-bottom: 50px;
  box-shadow: 0 0 11px rgba(33, 33, 33, 0.2), 2px 2px 2px var(--brand_color_1);
  background: var(--gray_card);
}

main.meet-cute--individual_issue section {
  display: flex;
  flex-direction: column;
  align-self: center;
  width: 100%;
  margin-top: 50px;
  margin-bottom: 50px;
}

/* Default font-size of 18px for paragraphs across all sections. */

main.meet-cute--individual_issue section p {
  font-size: 18px;
}

/* Enlarge & darken first paragraph of each section. */

main.meet-cute--individual_issue section p:first-of-type {
  font-size: 25px;
  font-weight: 700;
}

/* Individual section "header" divs */

.mc-section_title--outer {
  /* position: sticky;
	top: 5; */
  align-self: center;
  width: 95%;
  margin-top: 25px;
  margin-bottom: 25px;
  padding: 10px;
  background: var(--brand_color_1);
  box-shadow: 2px 2px 2px black;
  z-index: 999;
}

.mc-section_title--inner {
  text-align: center;
  width: 100%;
  border: 8px solid var(--brand_color_2);
  padding: 25px;
  background: var(--brand_color_1);

  & span {
    /* A Message From Coach Bernadette, Dating Deep Dive, New Glossary of Modern Romance, &tc. */
    font-size: 30px;
    font-weight: 700;
    color: var(--white);
  }
}

/* Align text blocks across all sections with left-hand side of "header" divs */
/* NOTE:  The "width" setting must match .mc-section_title--outer width in order for this alignment to work! */

.mc-section--text_block {
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  /* The width of this element is a KEY PIECE of RESPONSIVE ARCHITECTURE! */
  width: 60%;
  align-self: center;
}

/* #endregion */

/* #region MEET-CUTE - LINKS */

.meet_cute--citation {
  font-size: 1.2rem;
}

#heart_beat .heart_beat-icon_link {
  /* Removes default animated underline styling from Heart Beat 
      Font Awesome icon links. */
  background-image: none;
}
/* #endregion */

/* #region MEET-CUTE -- MASTHEAD */

main.meet-cute--individual_issue section#masthead img#masthead {
  align-self: center;
  width: 100%;
  height: 100%;
}

.meetcute-masthead--outermost {
  width: 100%;
  height: 100%;
  height: auto;
}

.meetcute-masthead--top {
  width: 100%;
  height: 5vh;
  /* Background image generated using Hero Patterns' Zig Zag pattern.
	      https://www.heropatterns.com/ */
  background-color: #ee3495;
  background-image: url("data:image/svg+xml,%3Csvg width='40' height='12' viewBox='0 0 40 12' xmlns='https://www.w3.org/2000/svg'%3E%3Cpath d='M0 6.172L6.172 0h5.656L0 11.828V6.172zm40 5.656L28.172 0h5.656L40 6.172v5.656zM6.172 12l12-12h3.656l12 12h-5.656L20 3.828 11.828 12H6.172zm12 0L20 10.172 21.828 12h-3.656z' fill='%23dd137b' fill-opacity='0.4' fill-rule='evenodd'/%3E%3C/svg%3E");
  border-bottom: 5px solid var(--brand_color_2);
}

.meetcute-masthead--title {
  background: var(--white);
}

.meetcute-masthead--title h1 {
  text-align: center;
  margin-right: 50px;
  font-size: 100px;
  color: transparent;
  -webkit-text-fill-color: transparent;

  /* Linear gradient generated using Coolers.io's Gradient Maker 
	      https://coolors.co/gradient-maker/dd137b-e52c87-ed4593-f55d9e-ff7bac-fe84b2-fd8cb8-fd93bd-fc9ac2?position=0,11,22,33,49,64,77,89,100&opacity=100,100,100,100,100,100,100,100,100&type=linear&rotation=45 */
  background-image: linear-gradient(
    45deg,
    hsla(329, 84%, 47%, 1) 0%,
    hsla(330, 78%, 54%, 1) 11%,
    hsla(332, 82%, 60%, 1) 22%,
    hsla(334, 88%, 66%, 1) 33%,
    hsla(338, 100%, 74%, 1) 49%,
    hsla(337, 98%, 76%, 1) 64%,
    hsla(337, 97%, 77%, 1) 77%,
    hsla(336, 96%, 78%, 1) 89%,
    hsla(336, 94%, 80%, 1) 100%
  );
  background-image: -webkit-linear-gradient(
    45deg,
    hsla(329, 84%, 47%, 1) 0%,
    hsla(330, 78%, 54%, 1) 11%,
    hsla(332, 82%, 60%, 1) 22%,
    hsla(334, 88%, 66%, 1) 33%,
    hsla(338, 100%, 74%, 1) 49%,
    hsla(337, 98%, 76%, 1) 64%,
    hsla(337, 97%, 77%, 1) 77%,
    hsla(336, 96%, 78%, 1) 89%,
    hsla(336, 94%, 80%, 1) 100%
  );
  background-image: -moz-linear-gradient(
    45deg,
    hsla(329, 84%, 47%, 1) 0%,
    hsla(330, 78%, 54%, 1) 11%,
    hsla(332, 82%, 60%, 1) 22%,
    hsla(334, 88%, 66%, 1) 33%,
    hsla(338, 100%, 74%, 1) 49%,
    hsla(337, 98%, 76%, 1) 64%,
    hsla(337, 97%, 77%, 1) 77%,
    hsla(336, 96%, 78%, 1) 89%,
    hsla(336, 94%, 80%, 1) 100%
  );
  background-image: -ms-linear-gradient(
    45deg,
    hsla(329, 84%, 47%, 1) 0%,
    hsla(330, 78%, 54%, 1) 11%,
    hsla(332, 82%, 60%, 1) 22%,
    hsla(334, 88%, 66%, 1) 33%,
    hsla(338, 100%, 74%, 1) 49%,
    hsla(337, 98%, 76%, 1) 64%,
    hsla(337, 97%, 77%, 1) 77%,
    hsla(336, 96%, 78%, 1) 89%,
    hsla(336, 94%, 80%, 1) 100%
  );
  background-image: -o-linear-gradient(
    45deg,
    hsla(329, 84%, 47%, 1) 0%,
    hsla(330, 78%, 54%, 1) 11%,
    hsla(332, 82%, 60%, 1) 22%,
    hsla(334, 88%, 66%, 1) 33%,
    hsla(338, 100%, 74%, 1) 49%,
    hsla(337, 98%, 76%, 1) 64%,
    hsla(337, 97%, 77%, 1) 77%,
    hsla(336, 96%, 78%, 1) 89%,
    hsla(336, 94%, 80%, 1) 100%
  );
  background-size: 400%;
  background-clip: text;
  -webkit-background-clip: text;
  animation: meetcute--masthead--gradient 5s infinite alternate;
}

