/* Center "Welcome, Fabulous Single!" div */

#flex_container--welcome {
  justify-content: space-evenly;
  align-items: center;
  padding: calc(var(--gray_hero--top_and_bottom_padding) * 0.75);
}

#welcome_image_and_animation {
  position: relative;
}

/* Size Coach Berandette Exported from Adobe Character Animator */

#welcome_image_and_animation img {
  /* Placeholder for any future CSS that may be needed. */
}

/* Position animated hearts just above & to the right of Coach Bernadette's right-hand. */
/*    GRMA https://codepen.io/z-/pen/bpxgWZ */

span.hearts_block {
  position: absolute;
  text-align: center;
  top: 80px;
  font-size: 8px;
  color: transparent;
}

/* Style animated hearts */

.hearts > .particle {
  opacity: 0;
  position: absolute;
  background-color: rgba(204, 42, 93, 1);
  animation: hearts 5s ease-in infinite;
}
.hearts > .particle:before,
.hearts > .particle:after {
  position: absolute;
  content: "";
  border-radius: 100px;
  left: 0px;
  width: 100%;
  height: 100%;
  background-color: rgba(204, 42, 93, 1);
}

.hearts > .particle:before {
  transform: translateX(-50%);
}
.hearts > .particle:after {
  transform: translateY(-50%);
}

/* Style text to the right of Coach Bernadette. */

#welcome_text {
  align-items: center;
  padding: 0px;
}

#welcome_text {
  p {
    max-width: 35ch;
    font-size: 1.25rem;
  }

  p:first-of-type {
    font-weight: 700;
    font-size: 30px;
    font-size: 2rem;
  }
}

p#welcome_text--cc_summary {
  align-self: center;
  text-align: center;
}

#welcome_text--card {
  justify-content: center;
  align-items: center;
  align-self: center;
  width: 85%;
  /* align-items: center;
  border-radius: var(--card--border_radius);
  padding: 20px; */
}

#welcome_text--card {
  p:first-of-type {
    text-align: center;
    margin-bottom: 25px;
    font-size: 1.5rem;
