/* ----- 🧩🧩🧩 SECTION: What Is Compatibility?  Why Is It Important? & Explore Our Website 🧩🧩🧩 ----- */

#gray_card--what_is_compatibility .gray_card--image_and_text_block,
#gray_card--explore_our_website .gray_card--image_and_text_block {
  justify-content: space-around;
}

/* Apply margin to the right-hand side of "What Is Compatibility" images to prevent
    text to their right from getting too close to image prior to flex wrapping. */
#gray_card--what_is_compatibility .gray_card--image_and_text_block img {
  align-self: center;
  margin-right: 35px;
}

.compatibility_text {
  /* Set an explicit width to ensure image & text blocks
        with different line lengths wrap at the same breakpoints! */
  width: 550px;
}

/* ----- 🧩🧩🧩 SECTION: Explore Our Website 🧩🧩🧩 ----- */

#gray_card--explore_our_website .gray_card--image_and_text_block {
