#gray_card--explore_our_website p {
  max-width: 52ch;
  font-size: 1.25rem;
  font-weight: 500;
}

/* ----- 🧩🧩🧩 SECTION: Let's Connect! 🧩🧩🧩 ----- */

.container--lets_connect {
  width: 100%;
  justify-content: space-evenly;
  padding: 50px 0px;
  background: whitesmoke;
}

.container--lets_connect {
  p {
    margin: 10px;
    margin-left: 40px;
    margin-right: 40px;
    max-width: 50ch;
    font-size: 18px;
