    margin-bottom: 25px;
  }

  #gray_card--what_is_compatibility p:first-of-type,
  #gray_card--explore_our_website h3 {
    text-align: center;
  }

  #paper--cc_lets_connect {
    margin-bottom: 25px;
    transform: none;
  }
}

/* #endregion */

/* #region Media Queries - Tablets */

@media screen and (min-width: 577px) and (max-width: 1024px) {
  #gray_card--what_is_compatibility
    .gray_card--image_and_text_block
    p:first-of-type {
    margin-top: 25px;
  }

  #gray_card--explore_our_website
    .gray_card--image_and_text_block
