}

/* #endregion */

@media screen and (min-width: 575px) and (max-width: 986px) {
  #paper--cc_lets_connect {
    margin-bottom: 25px;
    transform: none;
  }
}

@media screen and (min-width: 0px) and (max-width: 522px) {
  #gray_card--what_is_compatibility h2 {
    /* Adjust line-height when 'Why Is It Important?' wraps so 
        lines aren't spaced too far apart. */
    line-height: 1.25;
  }
  #gray_card--what_is_compatibility h2 span {
    /* Prevent 'Why Is It Important?' from getting too close to
        'What Is Compatibility?' */
    padding-top: 20px;
  }
}
/* #endregion */

